const fetchSheetData = async () => {
  try {
    const response = await fetch(
      'https://sheets.googleapis.com/v4/spreadsheets/1qyrlI0zxKX_Hn4E3DnCU29NEuMiwnKBoONk18kppfBQ/values/Sheet1!B:C?key=AIzaSyDfQX-VToR_ylK405gBCCX5_u0wQeNBxnY'
    );

    if (!response.ok) {
      throw new Error(`HTTP error! Status: ${response.status}`);
    }

    const data = await response.json();
    console.log("Fetched sheet data:", data.values); // ✅ Log fetched data for debug

    // ✅ Optional: Skip header row if it exists (uncomment if you have headers)
    // return data.values.slice(1);

    return data.values; // Return the data (raw rows)
  } catch (error) {
    console.error("Error fetching Google Sheets data:", error);
    return []; // Return empty array on error
  }
};

export default fetchSheetData;
